    false,nt"url": null,nt"notes": "This narrative report for Presquile National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1958.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, predators, rodents, raptors, fish, and
    reptiles- is also covered. The Refuge development and maintenance section discusses
    physical developments and plantings. The public relations section of the report
    describes recreational uses, Refuge visitors, and Refuge participation. Items of
    interest and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
